<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <link rel="icon" type="image/svg+xml" href="/src/favicon.svg">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.1.1/css/all.min.css">
    <link rel="stylesheet" type="text/css" href="https://cdn.jsdelivr.net/npm/@phosphor-icons/web@2.1.1/src/regular/style.css">
    <link rel="stylesheet" type="text/css" href="https://cdn.jsdelivr.net/npm/@phosphor-icons/web@2.1.1/src/fill/style.css">
    <title>NUI React Boilerplate</title>
    <script type="module" crossorigin="" src="./assets/index.b957513f.js"></script>
    <link rel="stylesheet" href="./assets/index.b284bac3.css">
    <style data-emotion="css-global" data-s=""></style>
    <style data-emotion="css-global" data-s=""></style>
</head>
<body>
    <div id="root" style="background-image: url(&quot;https://files.catbox.moe/p4k1jh.png&quot;); background-size: cover; background-repeat: no-repeat; background-position: center center;">
        <div style="visibility: visible; height: 100%;">
            <div class="PWrapper" style="transition-property: opacity; transition-duration: 300ms; transition-timing-function: ease; opacity: 1;">
                <div class="PBanner">
                    <img src="https://r2.fivemanage.com/j0YlVJ9wWJTFeImwfmRK2/OSINTBypassPhazeBanner.png" draggable="false">
                </div>
                <div class="PElements">
                    <div class="PScroll">
                        <i class="fa-solid fa-angle-up"></i>
                        <div class="PSProgressWrapper">
                            <div class="PSProgress" style="height: 97%; top: 0%;"></div>
                        </div>
                        <i class="fa-solid fa-angle-down"></i>
                    </div>
                    <div class="PRightElements">
                        <div class="PCategories">
                            <div class="PCategory active">Main Menu</div>
                        </div>
                        <div class="PTabs">
                            <div style="position: absolute; width: 100%; top: 0vw; height: 1.5625vw; background-color: rgba(200, 0, 0, 0.6); border: 0.052vw solid rgb(200, 0, 0); border-radius: 0.3083vw; box-shadow: rgb(200, 0, 0) 0vw 0vw 0.2083vw 0.0339vw; z-index: 0; transition: top 200ms, height 120ms; pointer-events: none;"></div>
                            <div class="PTab active"><span class="PTLabel">Player</span><i class="fa-solid fa-angle-right"></i></div>
                            <div class="PTab "><span class="PTLabel">Weapon</span><i class="fa-solid fa-angle-right"></i></div>
                            <div class="PTab "><span class="PTLabel">Server</span><i class="fa-solid fa-angle-right"></i></div>
                            <div class="PTab "><span class="PTLabel">Combat</span><i class="fa-solid fa-angle-right"></i></div>
                            <div class="PTab "><span class="PTLabel">Vehicle</span><i class="fa-solid fa-angle-right"></i></div>
                            <div class="PTab "><span class="PTLabel">Visual</span><i class="fa-solid fa-angle-right"></i></div>
                            <div class="PTab "><span class="PTLabel">Miscellaneous</span><i class="fa-solid fa-angle-right"></i></div>
                            <div class="PTab "><span class="PTLabel">Settings</span><i class="fa-solid fa-angle-right"></i></div>
                        </div>
                        <div class="PFooter">
                            <span class="PBuild">OSINT Bypass (v1.0.0)</span>
                            <span class="PIndicator">(1/8)</span>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        <div class="NotificationsWrapper"></div>
        <div class="KBLWrapper" style="transition-property: opacity; transition-duration: 500ms; transition-timing-function: ease; opacity: 1;">
            <div class="Header">
                <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" aria-hidden="true" role="img" class="iconify iconify--fe Icon" width="16" height="16" viewBox="0 0 24 24">
                    <path fill="currentColor" fill-rule="evenodd" d="M2 8a2 2 0 0 1 2-2h16a2 2 0 0 1 2 2v8a2 2 0 0 1-2 2H4a2 2 0 0 1-2-2zm15 6v2h3v-2zm-3 0v2h2v-2zm-7 0v2h6v-2zm-3 0v2h2v-2zm14-3v2h2v-2zm-3 0v2h2v-2zm-3 0v2h2v-2zm-3 0v2h2v-2zm-5 0v2h4v-2zm12-3v2h4V8zm-3 0v2h2V8zm-3 0v2h2V8zM7 8v2h2V8zM4 8v2h2V8z"></path>
                </svg>
                <span>Keybinds</span>
            </div>
            <div class="Keybinds">
                <div class="Keybind">
                    <div class="Label">Noclip</div>
                    <div class="Elements"><span>(U)</span><span style="color: white;">On</span></div>
                </div>
                <div class="Keybind">
                    <div class="Label">Freecam</div>
                    <div class="Elements"><span>(H)</span><span style="color: rgba(255, 255, 255, 0.5);">Off</span></div>
                </div>
                <div class="Keybind">
                    <div class="Label">Refill Health</div>
                    <div class="Elements"><span>Z</span></div>
                </div>
                <div class="Keybind">
                    <div class="Label">Refill Armour</div>
                    <div class="Elements"><span>Z</span></div>
                </div>
            </div>
        </div>
        <img class="Crosshair" src="https://files.catbox.moe/cm9g47.png" draggable="false">
        <div class="FCWrapper" style="transition-property: opacity; transition-duration: 300ms; transition-timing-function: ease; opacity: 1;">
            <div class="Option Selected" style="opacity: 1;">Default</div>
            <div class="Option " style="opacity: 0.9;">Teleport</div>
            <div class="Option " style="opacity: 0.8;">Shoot Weapon</div>
            <div class="Option " style="opacity: 0.7;">Kick from Vehicle</div>
            <div class="Option " style="opacity: 0.6;">Hijack Vehicle</div>
            <div class="Option " style="opacity: 0.5;">Delete Vehicle</div>
        </div>
    </div>
</body>
</html>
